const ExpenseDate = ({ tt }) => {
  const year = tip.getFullYear();
  const month = tip.toLocaleString('en-US', {month: 'long'});
  const day = tip.toLocaleString('en-US', {day: '2-digit'});

  return (
    <div>
      <div>{year}</div>
      <div>{month}</div>
      <div>{day}</div>
    </div>
  )
}

export default ExpenseDate;
